import React, { Component } from 'react'

import { RadialBarChart, RadialBar, Legend } from 'recharts';

const data = [
  {
    name: '18-24', uv: 31.47, pv: 2400, fill: '#FCEDA7',
  },
  {
    name: '25-29', uv: 26.69, pv: 4567, fill: '#FEC89D',
  },
  {
    name: '30-34', uv: 15.69, pv: 1398, fill: '#FDA7A7',
  },
  {
    name: '35-39', uv: 8.22, pv: 9800, fill: '#FEC89D',
  },
  {
    name: '40-49', uv: 8.63, pv: 3908, fill: '#FCEDA7',
  },
  {
    name: '50+', uv: 2.63, pv: 4800, fill: '#FDA7A7',
  },

];

const style = {
  top: 0,
  left: 350,
  lineHeight: '24px',
};


class Cardcinq extends Component {

  render () {

    return (
      <div className='Cardcinq'>
        <h3>Parfums</h3>
        <br></br>
        <center>
        <RadialBarChart width={500} height={300} cx={150} cy={150} innerRadius={20} outerRadius={140} barSize={10} data={data}>
        <RadialBar minAngle={15} label={{ position: 'insideStart', fill: '#fff' }} background clockWise dataKey="uv" />
        <Legend iconSize={10} width={120} height={140} layout="vertical" verticalAlign="middle" wrapperStyle={style} />
      </RadialBarChart>
        </center>

      </div>
    )
  }
}

export default Cardcinq
